import React, { useState } from 'react'
function TodoItem(props) {
    // console.log(props.todo)
    const [dropDown, setDropDown] = useState('none')

    return (
        <div>
            <input
                type='checkbox'
                className='checkBox'
                value={props.todo.checkbox}
            ></input>
            <input
                type='text'
                className='todoTitle'
                value={props.todo.title}
            ></input>
            <div></div>
        </div>
    )
}
export default TodoItem
